import React from "react";
import './Apresentacao.css';


function Apresentacao(){
    function Entrar(){
        alert('OI')
    }
    return(
        <div className="body">
            <div className="imgApresentacao">
                <button onclick='Entar()' >Entrar</button>
            </div>
        </div>
    )

}

export default Apresentacao;
